import axios from "axios";
import MockAdapter from "axios-mock-adapter";
import { ApiTypes } from "../types/api";

export const api = axios.create({
  baseURL: "",
  headers: {
    "Content-Type": "application/json",
    Accept: "application/json",
  },
});

/**
 * Stringifies data, converting any bigint values to strings.
 */
export function stringifyJson<T>(data: T) {
  return JSON.stringify(data, (_, value) =>
    typeof value === 'bigint'
      ? value.toString()
      : value
  )
}

// Convert any bigint values in request data to strings prior to serialization
api.interceptors.request.use((req) => {
  req.data = JSON.parse(stringifyJson(req.data));

  return req;
});

/*

SEE API DOCS: https://github.com/mlabs-haskell/playermint/blob/master/docs/api-spec.md

--------- SOME EXAMPLES: ---------

API.market.showNft('12lnsldasd').then(res => console.log(res.data))

API.leaderboard.view().then(res => console.log(res.data))

API.market.changePrice({newPrice: 10000n}, '1231dasd').then(res => console.log(res.data))

API.market.search({minPrice: 10}).then(res => console.log(res))

*/

export const API = {
  account: {
    create: async (data: ApiTypes.Req.CreateAccount) => {
      return api.post<ApiTypes.Req.CreateAccount>("/account/create", data);
    },
    view: async (accountId: string) => {
      // Real URL: `/account/${accountId}`
      return api.get<ApiTypes.Res.ViewAccount>("/account");
    },
    update: async (data: ApiTypes.Req.UpdateAccount) => {
      return api.put<ApiTypes.Req.UpdateAccount>("/account/update", data);
    },
  },
  leaderboard: {
    view: async () => {
      return api.get<ApiTypes.Res.ViewLeaderboard>("/leaderboard");
    },
    ranking: async (userId: string) => {
      // Real URL: `/leaderboard/${userId}`
      return api.get<ApiTypes.Res.LeaderboardRanking>("/leaderboard/ranking");
    },
  },
  market: {
    showNft: async (id: string) => {
      // Real URL: `/market/show/${Id}`
      return api.get<ApiTypes.Model.NFTInfo>("/market/show");
    },
    mintNFT: async (data: ApiTypes.Req.MintNFT) => {
      return api.post<ApiTypes.Req.MintNFT>("/mint", data);
    },
    changePrice: async (data: ApiTypes.Req.ChangePrice, nftId: string) => {
      // Real URL: `/market/changeprice/${nftId}`
      return api.put<ApiTypes.Req.ChangePrice>("/market/changeprice", data);
    },
    removeFromSale: async (nftId: string) => {
      // Real URL: `/market/removefromsale/${nftId}`
      return api.delete("/market/removefromsale");
    },
    buyNft: async (nftId: string, buyerId: string) => {
      // Real URL: `/market/buy/${nftId}/${buyerId}`
      return api.post("/market/buy");
    },
    sellNft: async (nftId: string) => {
      // Real URL: `/market/sell/${nftId}`
      return api.post("/market/sell");
    },
    search: (params: ApiTypes.Req.SearchMarketParams) => {
      return api.get<ApiTypes.Res.SearchMarket>("/market/search", {
        params: params,
      });
    },
  },
};

