export const buildMockNft = (id: number): ApiTypes.Model.NFTInfo => {
  return {
    id: id.toString(),
    name: `Test NFT ${id}`,
    price: 10000000n,
    filename: `https://picsum.photos/id/${id * 3 + 11}/600/600`,
    numEditions: 0,
    previousOwners: [user1, user2],
    lastSalePrice: 9500000n,
    properties: "",
    royalties: 10000,
    description: mockDescription,
  };
};

export const buildMockNfts = (count: number, startNum?: number) =>
  [...Array(count).keys()].map((id) => buildMockNft(id + (startNum ?? 0)));

const buildMockLeader = (rank: number) => {
  return {
    name: `Player ${rank}`,
    profilePicture: `https://picsum.photos/id/${rank}/100/100`,
    rank: rank,
    kills: rank === 0 ? 0 : Math.round(1000 / rank),
    estimatedPayout: 100,
  };
};

const buildMockLeaders = (count: number) =>
  [...Array(count).keys()].map((id) => buildMockLeader(id));

